import{_ as e,o as t,c as a,O as o}from"./chunks/framework.9482e208.js";const g=JSON.parse('{"title":"§ 3.2-5904 Authority of the Commissioner; coyotes; black vultures.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/3.2-5904.md","filePath":"vacode/3.2-5904.md"}'),r={name:"vacode/3.2-5904.md"},i=o('<h1 id="§-3-2-5904-authority-of-the-commissioner-coyotes-black-vultures" tabindex="-1">§ 3.2-5904 Authority of the Commissioner; coyotes; black vultures. <a class="header-anchor" href="#§-3-2-5904-authority-of-the-commissioner-coyotes-black-vultures" aria-label="Permalink to &quot;§ 3.2-5904 Authority of the Commissioner; coyotes; black vultures.&quot;">​</a></h1><p>The Commissioner may enter into agreements with local and state agencies, or other persons for the control of coyotes, black vultures (Coragyps atratus), and other wildlife that pose a danger to agricultural animals. The Commissioner shall enter into an agreement with the federal government to establish and maintain the Virginia Cooperative Wildlife Damage Management Program.</p><p>1990, c. 682, § 3.1-796.67:1; 2008, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?081+ful+CHAP0860" target="_blank" rel="noreferrer">860</a>; 2010, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?101+ful+CHAP0761" target="_blank" rel="noreferrer">761</a>; 2016, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?161+ful+CHAP0059" target="_blank" rel="noreferrer">59</a>.</p>',3),s=[i];function n(l,c,h,m,_,u){return t(),a("div",null,s)}const d=e(r,[["render",n]]);export{g as __pageData,d as default};
